import React from "react";

function Home() {
    return (
        <>
            <div class="media">
                <h3>Amy Moseman</h3>


                <a target="_blank" href="https://www.facebook.com/Amoseman18/"><i id="icons" className="fab fa-facebook"></i></a>
                <a target="_blank" href="https://github.com/amoseman1"><i id="icons" className="fab fa-github"></i></a>
                <a target="_blank" href="https://www.linkedin.com/in/amy-moseman-7867a9158"><i id="icons" className="fab fa-linkedin"></i></a>

            </div>
        </>
    );
}

export default Home;
